import React from 'react'
import "../../assets/css/sidemenu.css";

const UserPage = () => {
  return (
    <div className='mainmenu d-flex pt-4 flex-wrap ps-4'>
        <div>
            <img src={require("../../assets/image/avatarL.png")} alt="Id number" height={"150"}/>
        </div>
        <div className='ms-3'>
            <h3>Vansham</h3>
        </div>
    </div>
  )
}

export default UserPage
